import React, { Component } from 'react';

class WalletForm extends Component {
  render() {
    return (
      <div>
        <label htmlFor="number">
          Valor: <br />
          <input id="number" type="number" />
        </label>
      </div>
    );
  }
}

export default WalletForm;
